import { Button } from "semantic-ui-react";

export const Kategorite = () => {
  return (
    <Button.Group>
      <Button>Kompjuterë</Button>
      <Button>Kompjuterë</Button>
      <Button>Three</Button>
      <Button>One</Button>
      <Button>Two</Button>
      <Button>Three</Button>
    </Button.Group>
  );
};
